import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {options} from '../config'
import {TreeGraph} from "./TreeGraph";
import Footer from './footer';
import logo from '../style/assets/logo-UA.jpg'

import GitHubButton from 'react-github-btn'

import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Navbar from "react-bootstrap/Navbar";
import NavbarBrand from "react-bootstrap/NavbarBrand";

function App() {

    return (

        <React.Fragment>
            <Navbar bg={"dark"} variant={"dark"}>
                <NavbarBrand>
                    Binary Tree Visualizer
                </NavbarBrand>
                <div className={"ml-auto mt-2"}>
                    <GitHubButton href="https://github.com/FreekDS/BinaryTree/"
                                  aria-label="Tarun Gangadhar/Github">Source code</GitHubButton>
                </div>
            </Navbar>

            <Container fluid className={"h-130"}>
                <Row className={"mt-2 mb-1"}>
                    <TreeGraph options={options}/>
                </Row>

            </Container>

            <Footer />
        </React.Fragment>
    );
}

export default App;
